import axiosDB from '../../../utils/axios/axiosConfig'

const UpgradeBoostPopup = ({
	handlePopupClose,
	boost,
	userData,
	updateBoostData,
}) => {
	const upgradeBoost = async () => {
		try {
			const response = await axiosDB.put(
				`/upgradeBoost/${userData.telegramId}/${popupInfo.name}`
			)
			console.log(response)
			updateBoostData() // Update the boost data after successful activation
		} catch (error) {
			console.log(error)
		}
	}
	return (
		<div className='popup-overlay' onClick={handlePopupClose}>
			<div className='popup block'>
				<div id='boost-info'>
					<div className='popup-icon'>
						<img src={popupInfo.iconSrc} alt='boost icon' />
					</div>
					<h3 className='popup-title'>{popupInfo.title}</h3>
				</div>
			</div>
		</div>
	)
}

export default UpgradeBoostPopup
